import React from 'react';

const Todo = () => {
   return ( 
      <div className="todo">
         <li className="todo-item">HEyyy</li>
         <button className="complete-btn"><i class="fa fa-minus-circle" aria-hidden="true"></i></button>
         <button className="complete-btn"><i class="fa fa-minus-circle" aria-hidden="true"></i></button>
      </div>
    );
}
 
export default Todo;
